import './App.css';
import Form from './modules/Form'; // Ensure the path is correct
import Dashboard from './modules/Dashboard'; // Ensure the path is correct
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Dashboard />} />
        <Route path='/users/sign_in' element={<Form isSignInPage={true} />} />
        <Route path='/users/sign_up' element={<Form isSignInPage={false} />} />
      </Routes>
    </Router>
  );
}

export default App;
